import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import ImagenList from "../components/ImagenList";
function Images() {
  return (
    <Container>
      <Row>
        <h1>Imagens</h1>
      </Row>
      <ImagenList />
    </Container>
  );
}

export default Images;
